import React from 'react';
import { useNavigate } from 'react-router-dom';
import FileCloak from '../FileCloak.webp';
import './SignUp.css';

function SignUp() { // Correct component name
  const navigate = useNavigate();

  const handleNavigation = (path) => {
    navigate(path);
  };

  return (
    <>
      <div class="login-container" id="registerForm">
        <div class="logo-container">
        <img src={FileCloak} className="HomePage-logo" alt="FileCloak" />
        </div>
        <form class="login-form">
            <div class="input-group">
                <input type="text" id="email" name="email" placeholder="Email" required></input>
                <i class="icon email-icon"></i> 
            </div>
            <div class="input-group">
                <input type="password" id="password" name="password" placeholder="Password" required></input>
                <i class="icon password-icon"></i> 
            </div>
            <div class="input-group">
                <input type="password" id="repeatPassword" name="repeatPassword" placeholder="Repeat Password" required></input>
                <i class="icon password-icon"></i> 
            </div>
            <button type="submit" class="button" value="Register">SIGNUP</button>
            <button className="button-login" onClick={() => handleNavigation('/login')}>Login</button>
        </form>
    </div>
    </>
  );
}

export default SignUp;
